INSERT INTO `issues` (`id`, `name`, `solution`, `issue_master`) VALUES
	(9, 'Point terminal on latest release', '\r\n<ul style="list-style-type: disc;">\r\n    <li>Get terminal S/N (Func +74) and enter into TMS</li>\r\n    <li>Select appropriate S/W from &lsquo;Release&rsquo; drop down box</li>\r\n    <li>Click on &lsquo;Change&rsquo; button to save the changes</li>\r\n</ul>\r\n', 1),
	(10, 'Assign correct Logo', '\r\n<ul style="list-style-type: disc;">\r\n    <li>Get terminal S/N and enter it into TMS</li>\r\n    <li>Click on &lsquo;Skyzer parameters&rsquo;</li>\r\n    <li>Select the correct LOGO from the LOGOs button (Idle 1 &amp; Idle 2 both )</li>\r\n    <li>Click on update record to save the changes</li>\r\n</ul>\r\n', 1),
	(11, 'Terminal is not contacting TMS', '\r\n<ul style="list-style-type: disc;">\r\n    <li>Check on TMS whether terminal is on prevent download or not</li>\r\n    <li>If terminal is on TCP-IP, perform PING TEST under Func + 9904, it should pass</li>\r\n    <li>If comms mode is GPRS make sure the SIM has enough credit</li>\r\n    <li>Check port number under Func + 2467, it has to be either 3200 or 3201</li>\r\n    <li>Check with Shani about TMS status and particular terminal (why not contacting)</li>\r\n</ul>\r\n', 1),
	(12, 'Terminal not doing RKI', '\r\n<ul style="list-style-type: disc;">\r\n    <li>Make sure terminal is getting an internet connectivity</li>\r\n    <li>Check terminal and Merchant ID</li>\r\n    <li>Ensure terminal ID is still active from Paymark end</li>\r\n    <li>If Terminal is on NITRO mode (Deactivate Nitro and try)</li>\r\n</ul>\r\n', 2),
	(13, 'RSA key requires', '\r\nCould be  production issue, Production havent loaded keys or failed paymark reply.\r\n', 2),
	(14, 'How to check key size on the terminal', '\r\n<ul style="list-style-type: disc;">\r\n    <li>Perform following functions to check key size</li>\r\n    <li>Menu + supervisor menu + extra + Number 2 (at terminal functions) + enter</li>\r\n    <li>Terminal will print out one receipt, &lsquo;RKI key size&rsquo; will be prompt under &lsquo;COMPLIANCE &lsquo;segment</li>\r\n</ul>\r\n', 2),
	(15, 'Stuck on smile face', '\r\nN/A\r\n', 3),
	(16, 'How to attach Pinpad with terminal', '\r\n<ul style="list-style-type: disc;">\r\n    <li>Tetra terminals will automatically recognise PINPADs</li>\r\n    <li>For telium terminals press menu + zero + Password ( 6988 OR 62624371 ) + Telium Manager + Initialization + Parameters + PINPAD+ select on &lsquo;YES&rsquo; + Choose IPP310 or IPP280</li>\r\n</ul>\r\n', 3),
	(17, 'PINPAD out of order', '\r\n•	N/A\r\n', 3),
	(18, 'Terminals shows “check cable lost with cash register”', '\r\n<ul style="list-style-type: disc;">\r\n    <li>Under Func + 6629 choose 1 for serial cable &amp; choose 2 for USB</li>\r\n    <li>Make sure the COM PORT number assign into &lsquo;Device Manager &lsquo; is the same under Linkly Client GUI .</li>\r\n    <li>Restart the services after changing the PORT number</li>\r\n    <li>Restart the EFTPOS machine and PC both</li>\r\n</ul>\r\n', 4),
	(19, 'Not printing receipt ', '\r\n<ul style="list-style-type: disc;">\r\n    <li>For Nitro terminals POS receipt, enter printer name into &lsquo;Printer&rsquo; box available under &lsquo;Linkly Client GUI for external printer, whereas for Eftpos printer please type &lsquo;NPT&rsquo; under printer box.</li>\r\n    <li>For standalone terminals, press Func + 7415, follow the prompts and turn on the &lsquo;CUST COPY&rsquo;</li>\r\n    <li>For Nitro terminals, press Func + 7418 + 3 (enable/ disable MERC receipt)</li>\r\n</ul>\r\n', 4),
	(20, 'Not picking up drivers', '\r\n<ul style="list-style-type: disc;">\r\n    <li>This issue usually happened when computer OS gets updated and customer is using old Nitro software along with old USB drivers. In order to resolve this issue, uninstall the old drivers first from <strong>Control panel -&gt; Programs -&gt; Uninstall Programs -&gt; Ingenico USB drivers</strong></li>\r\n    <li>Install the latest driver available at <strong>N :(drive) -&gt; AAPAYMENT -&gt; 15 INTERFACED -&gt; NITRO -&gt; Skyzer Nitro Installer 5.3.0 -&gt; USB Driver V.3.20</strong></li>\r\n</ul>\r\n', 4),
	(21, 'Issues related to HOSPITALITY', '\r\nN/A\r\n', 5),
	(22, 'Issues related to TIPPING', '\r\n<ul style="list-style-type: disc;">\r\n    <li>Press Func + 7415 and enable tipping (Instant tipping / CC tipping)</li>\r\n    <li>Maximum tip amount for Instant tipping is 30% of total amount</li>\r\n    <li>Maximum tip amount for CC tipping is 20% of total amount</li>\r\n</ul>\r\n', 5),
	(23, 'Issues related to SURCHARGE ', '\r\nN/A\r\n', 5),
	(24, 'How to Activate / Deactivate multi merchant', '\r\nPress Func 7418 + Multi Merchant Setup (Press 3) + enter merchants as require, For EX. For two merchants enter 12 for five merchant press 12345 + enter to save the changes.\r\n', 6),
	(25, 'Configure Merchant Name', '\r\n   <ul style="margin-bottom:0cm;list-style-type: disc;">\r\n        <li>Press Func + 7418 + Number 4 + Enter the merchant name + enter to save the changes</li>\r\n    </ul>\r\n', 6),
	(26, 'Eftpos Configuration', '\r\n    <ul style="margin-bottom:0cm;list-style-type: disc;">\r\n        <li>Press Func + 3824 + enter terminal ID + follow the prompts + COMMS MODE [ (change the Comms Mode as require) (1. Dial-up, <strong>2</strong>.TCP-IP/Dial Up ,<strong>3.</strong> TCP-IP,<strong>4.</strong> GPRS ,<strong>5.</strong> GPRS /Dial <strong>6.</strong> TCP-IP /GPRS, <strong>7.</strong> TCP-IP/GPRS/DIAL-Up,<strong>&nbsp;8.</strong> DIAL/GPRS 9. WI-FI)</li>\r\n    </ul>\r\n\r\n', 6),
	(27, 'Enable/disable Activata', '\r\n<ul style="margin-bottom:0cm;list-style-type: disc;">\r\n	<li>Press Func + 4001 for Enabling / Disabling Activata</li>\r\n</ul>\r\n', 7),
	(28, 'Activata Merchant Configuration', '\r\n<ul style="margin-bottom:0cm;list-style-type: disc;">\r\n	<li>Press Func 4824 + Enter and follow the prompts</li>\r\n	<li>Ensure terminal ID is the Activata Terminal ID & Merchant ID is first six digit of ‘ACTIVATA ID ‘</li>\r\n</ul>\r\n', 7),
	(29, 'Enable/ disable DCC', '\r\n<ul style="margin-bottom:0cm;list-style-type: disc;">\r\n	<li>Press Func + 3025707 for Enabling/ Disabling DCC</li>\r\n</ul>\r\n', 8),
	(30, 'DCC configuration', '\r\n<ul style="margin-bottom:0cm;list-style-type: disc;">\r\n	<li>Press Func + 3025703</li>\r\n</ul>\r\n', 8),
	(31, 'Downloading the Bin table and rates table', '\r\n<ul style="margin-bottom:0cm;list-style-type: disc;">\r\n	<li>Downloading Bin table: Press Func + 3025701</li>\r\n	<li>Downloading Rates table: Press Func + 3025702</li>\r\n</ul>\r\n', 8),
	(32, 'Base Pairing for Move/5000 & IWL 252', '\r\n<ul style="margin-bottom:0cm;list-style-type: disc;">\r\n	<li>Move/5000: Ensure terminal is on cradle</li>\r\n	<li>Press Menu + zero + password (6988) + Control Panel + Terminal Settings + Communication Means + Bluetooth + Base + Association + New base + Enter (association gets successful Indicates pairing successful)</li>\r\n	<li>IWL/ 252: Press Menu or F key + zero + password (62624371 or 6988) + Telium Manager + Initialization + hardware + cradle setup + Association + New Base + Enter</li>\r\n</ul>\r\n', 9),
	(33, 'Bluetooth pairing for ICMP / LINK devices', '\r\n<ul>\r\n<li>Press F Key</li>\r\n<li>At SUPERVISOR MENU screen, press 0 (zero) key</li>\r\n<li>At ENTER PASSWORD? screen, key in 6988 followed by ENTER</li>\r\n<li>At FUNCTIONS, press 0 (zero) to select TELIUM MANAGER</li>\r\n<li>At TELIUM MANAGER, press 5 to select INITIALISATION</li>\r\n<li>At INITIALISATION, press 2 to select HARDWARE</li>\r\n<li>At CONFIGURATION, scroll down by pressing F2 key or press 5 to select BLUETOOTH</li>\r\n<li>At BLUETOOTH press 2 to select PAIR WITH PHONE</li>\r\n</ul>\r\n', 9),
	(34, 'Interface Type', '\r\n<ul>\r\n<li>\r\n<ul>\r\n<li><strong>Two Types of interface: - </strong>1) One-Way</li>\r\n</ul>\r\n<p>2) Two-way</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<ul>\r\n<li><strong>Connection Type: - </strong>1) USB</li>\r\n</ul>\r\n<p>2) Serial</p>\r\n<ul>\r\n<li>Press Func + 6629 to change the Com Port from USB to Serial (RS232)</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n', 10),
	(35, 'No Communication between POS and Terminal', '\r\n<ul>\r\n<li>\r\n<ul>\r\n<li>\r\n<ul>\r\n<li>Firstly, check whether the POS is approved for Interface by Skyzer or not (N:AAPAYMENTS9 POS TESTING1. APPROVED POS LIST &ndash; PUBLISHED 1- and 2-way Interface accredited POS System)</li>\r\n<li>Check under Func + 6629 for right comport (USB / serial)</li>\r\n<li>Ensure, Interface is turned on under Func + 7415</li>\r\n<li>Check the com port number assigned is set up correctly on POS</li>\r\n<li>Press Func + 6628, Change Interface Type from Skyzer to Legacy (No2) and revert back again on Skyzer (No.1) and save it</li>\r\n<li>If none of the above works, restart the terminal and PC both</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n', 10),
	(36, 'How to Enable / Disable interface', '\r\n<ul>\r\n<li>Press Func + 7415 and follow the prompts, INTERFACED option will pop up at the end</li>\r\n<li>Turn Interface on for Enable, turn interface OFF for Disable</li>\r\n</ul>\r\n', 10),
	(37, 'Unknown', '\r\nN/A\r\n', 11),
	(38, 'Terminal activation/deactivation', '\r\n<ul>\r\n<li>Request must come from accounts to active/reactive terminal</li>\r\n<li>Enter requested serial number into TMS</li>\r\n<li>Select Skyzer parameters</li>\r\n<li>Tick/untick Enable/ Disable checkbox</li>\r\n<li>Click on update record button to save the changes</li>\r\n</ul>\r\n', 12),
	(39, 'Terminal recived/dispatched date', '\r\nN/A\r\n', 13),
	(40, 'NITRO licence key', '\r\n<ul>\r\n<li>Confirm with accounts team that terminal sold as a NITRO terminal</li>\r\n<li>Once confirmed, get the serial number</li>\r\n<li><strong>N:License Key GeneratorNitro License Key Generator </strong>open the Folder</li>\r\n<li>Enter last 6 digit of the serial number and it will generate the licence key</li>\r\n</ul>\r\n', 4),
	(41, 'NITRO setup', '\r\n<ul>\r\n<li>Remote installation of Nitro can be done upon special request</li>\r\n<li>At present the latest NITRO version is V.5.3.0</li>\r\n<li><strong>N:AAPAYMENTS15 INTERFACEDNitroNitroSkyzer Nitro Installer 5.3.0</strong></li>\r\n<li>Follow the path above and you will get each detail about latest Nitro</li>\r\n</ul>\r\n', 4),
	(42, 'IKR issue', '\r\nN/A\r\n', 1),
	(43, 'Manpan issue', '\r\n<ul>\r\n<li>Initiate transaction</li>\r\n<li>When terminal prompt for Insert/Present/swipe card press Func button and follow the prompts</li>\r\n</ul>\r\n', 14),
	(44, 'Reversal transactions', '\r\nN/A\r\n', 14),
	(45, 'Dial-up issues', '\r\nN/A\r\n', 1),
	(46, 'Contactless issue', '<p><strong>Tetra: </strong></p>\r\n<ul>\r\n<li><strong>Press Func + 7418 + 7 (Enable CTL/ Disable CTL) + Enter</strong></li>\r\n</ul>\r\n<p><strong>Telium: </strong></p>\r\n<ul>\r\n<li>Menu + press zero + PASSWORD? (6988/62624371) + Telium manager + initialization + parameters+ Contactless + select YES + Select &lsquo;INTERNAL&rsquo; for terminal only <strong><span style="text-decoration: underline;">OR</span></strong>select USB for PINPAD.</li>\r\n</ul>', 5),
	(55, 'IKR Certification Expired', '<p>In order to continue transacting please perform Func 77 to DISABLE EXTERNAL PINPAD. Terminal will restart and return to idle display allowing the merchant to continue transacting on terminal only. While Pinpad is still connected it will be display smiley face.&nbsp;</p>\r\n    <p>Alternatively if you like to remove Pinpad completely, then remove power to the terminal, unplug Pinpad and power terminal up again. Terminal will return to idle display ready for transacting.&nbsp;</p>\r\n    <p>Return the PINPad to Skyzer for reset and Certificate update at no charge.</p>\r\n    <p>For more: N:\\AAPAYMENTS\\Skyzer Bulletin\\Bulletins - Released\\Skyzer Bulletin 24 -How to recognise if the Ingetrust Keys have expired.pdf</p>', 15);
