	(292, 3, '2020-11-30', '13:02:04', 0, 0, 'Cherry', 47, 11, '20554061', 40, 9, 32, 'Cherry from Eftpos Specialist called in regards to these serial numbers aren\'t pairing with the base, 20554061/20554361, Troubleshooted with her and in the end advised her to send the terminals to Skyzer for upgrade. Since she didn\'t knew how old the bases were.  ', '', 'Cherry will be sending the Terminals with the bases. ', 1),
	(293, 4, '2020-11-30', '13:08:22', 0, 0, 'vivian', 3, 15, '', NULL, 11, 37, 'having issue when trying to do man pan on a multi merchant desk3200 error  "invalid merchant"', 'Man Pan issue / invalid merchant', 'i requested more info, like how many merchants, serial number and if the issue also happening on the other merchants or just 1 - he said he will call later with more details.', 1),
	(294, 1, '2020-11-30', '13:01:00', 0, 1, 'David', 34, NULL, '', NULL, 11, 37, 'Called: 0272155159', 'David from The Point of Sale Company is experiencing two issues as below:\r\n\r\n	MOVE5000 not charging when sitting on the cradle. When plugging the power cable on the side, it starts charging the battery but not through the cradle even sitting in properly.\r\n	IPP315 is not displaying anything on the screen when processing transactions. They can swipe the card which cards read but it doesnt display anything on the screen. Once the transaction is completed, it returned to the idle screen and then it displays the EFTPOS logo.\r\n', 'I have spoken with David as he was on lunch. I asked him to do the following troubleshooting steps;\r\nMove500:\r\nJust make sure that,\r\nterminal and base doesnt have any dust or something in between\r\nand make sure you put that terminal properly on the cradle.\r\n\r\nBut he was saying he tried with other bases too but still not working. \r\nSo I suggest him to try different terminal with the same base and see what happens. \r\n\r\n(Also asked him to call back to us if you still having an issue)\r\n\r\nIPP315: \r\n(Desk3200 with IPP315 is not updating the screen while doing transaction)\r\nTold him our team is working on that issue. Well get back to you shortly with solutions. \r\n', 1),
	(295, 3, '2020-11-30', '14:18:46', 0, 0, 'Sid', 48, 9, '', NULL, 11, 37, 'Customer using ICT 220 phone = Dial up\r\n\r\nSaturday started playing up and gave transmission error .', 'Dial up issue. ', 'He also advised that it was working fine all these years, Advised him to call the Telephone line provider Company to find out about any issues in the area.', 1),
	(296, 1, '2020-11-30', '15:10:19', 0, 0, 'John', 11, NULL, '', NULL, 11, 37, '', '3 terminals are given for NITRO when it would be ready to pick up?', 'Transferred to Service for that.', 1),
	(297, 1, '2020-12-01', '09:28:43', 0, 0, 'Gavin', 31, NULL, '', NULL, 11, 37, 'TIDs:\r\nM1: 04742401 -> Working\r\nM2: 04730501 -> Pending Transaction, Not working\r\n\r\n\r\nNilesh Spoke with Paymark:\r\nA day before TID2 is configured on other Machine. Also, updated to Gavin regarding this issue. ', 'Multi merchant: M2: Logon fails \r\n', 'As customer not on-site, suggest 2 cases\r\n1. double-check with terminal id and merchant id\r\n2. Make sure terminal id is active from paymark end.\r\n\r\nNR: Called Paymark Helpdesk. Reason terminal unable to upload pending reversal was maccing error. RKI was done yesterday @3.58pm on affected terminal ID. Gavin will bring in the terminal for our review. ', 1),
	(298, 1, '2020-12-01', '10:10:59', 0, 0, 'Haden', 10, 21, '', NULL, 11, 37, '', '2 terminal on Dial-up: \r\nLogon Accept but On Purchase showing transmission. \r\n\r\n', 'As he is not on-site, asked him to do merchant reconfigurations and do RKI, release, and Logon. \r\n\r\nResolved on 11/12/2020 as haven\'t heard back anything.', 1),
	(299, 1, '2020-12-01', '09:59:56', 0, 0, 'James', 41, NULL, '', NULL, 11, 37, '', 'How to setup interface with IWL?', 'As he did not have USB/Serial We can not anything.\r\nAlso, he was asking how o enable WIFI on IWL. \r\nSeems he wasn\'t a technician. So, asked him to get USB/Serial first and get Move5000/Desk5000 for wifi. Then I can help you further. ', 1),
