	(320, 3, '2020-12-03', '11:31:46', 0, 0, 'Chris', 4, NULL, '', NULL, 4, 41, 'Got all the info from Chris regards to "Menumate Nitro" issue, Chris advised they are having one of the earliest version of Nitro therefore I advised him to update the Nitro software and to check see how it goes, also advised that if this happens again we might need to get the Eftpos Log files from them to investigate further. ', 'Also advised Chris, that I received a call from one of the other Dealers yesterday and I installed the latest version and it fixed it.\r\n\r\nChris advised that : it holds the communication for 30 mins and it drops.\r\nthe issue is intermittent, at the moment 3 sites are effected. Advised Chris to go on Dealer zone and download the latest version to see if it fixes it self and to monitor it. Will update Vineel as well.', 'Called Chris regards to the issue today 13/01/2021 he advised that he hasn\'t installed the latest Nitro ver and he assumed that it was Menu mate people trying to put the blame on Skyzer, Therefore Chris advised that after that call he haven\'t received any calls regards to this current issue if he gets a call he advised that he will install the new Nitro version and will get back to us. ', 1),
	(329, 1, '2020-12-03', '11:57:30', 0, 0, 'David', 66, NULL, '25884932', NULL, 11, 37, 'Upgrade through Skyzer,\r\n', 'Can not find the Sim card network bar?\r\nProvider: Vodafone', 'Changed Select Service Provider: 7 - Global M2M\r\nDid restart > Bar come up but again went down and gone \r\n\r\nAs the battery was low he will call back.\r\n\r\nLater Ashen got the call and he requested customer to send that terminal back to Skyzer and do attention to Support Ashen.', 1),
	(330, 1, '2020-12-03', '12:21:27', 0, 0, 'Cherry', 49, 14, '', NULL, 11, 37, 'S/N: 01126099', 'Switched from wifi to SIM (Spark), showing SIM error', 'Test the same SIM in ICT250 and worked. Now gonna try in Move5000 back but as ICT250 doing the upgrade, He did not remove the SIM. He will be called back for it.\r\nHe inserted SIM in the wrong port. Asked him to insert it into SIM1 port and now up and running.', 1),
	(331, 3, '2020-12-03', '12:25:45', 0, 0, 'Davod', 66, 10, '21708398', NULL, 11, 37, 'David advised that he sent 2 terminals back for Software upgrade IWLs, After the upgrade he said Signal bars are there, 2 degrees and telephone Icon gray. Not connecting to Internet at all. ', 'GPRS issue. Two serial numbers _ 25884932 and 21708398', 'Same sim is working on other terminal. Advised him to send one of the terminals back to Support, "Attention to me" ', 1),
