	(335, 1, '2020-12-03', '15:47:22', 0, 0, 'Richard', 48, 21, '', NULL, 11, 37, '', 'Enabled Contactless a day before and that was working fine. A day after it disabled by itself, enabled, again and again, goes disable why is that so?', 'Enable contactless, do logon and restart(as he did not restart it could happen).\r\nSo, if still contactless not working you can send back to Skyzer with Attention to Jay.', 1),
