	(346, 1, '2020-12-04', '15:40:07', 0, 0, 'Alan', 48, 21, '', NULL, 4, 41, 'TeamID:857341841\r\nPass: menumatep0s\r\n\r\n\r\n\r\n', 'Alan had installed latest NITRo software and driver remotely in customer\'s PC but when in Device manager doesn\'t come up with COM port number why is that so?', 'Asked Alan to check with the customer whether did they checked with Port by doing F 6629?, and after installing software just make sure customer did restart the PC and EFTPOS terminal.\r\nAlan going to ask above question and let\'s see if still there is an issue then  I asked Alan to call back. \r\n\r\nAlan Called Again:\r\nAlan put me through Teamviewer and hung up and asked me to callback Alan in case I need any help. \r\nContact: 0272032505\r\n\r\nAlan hadn\'t installed the USB Driver. \r\nI installed driver and picked COM port and now showing Modem error.\r\nAsked Alan to call back to the customer and ask them to do RERKI.\r\n\r\nCustomer does not have Internet connection ON.\r\n\r\n\r\n\r\n\r\n', 1),
