	(376, 1, '2020-12-10', '10:16:51', 0, 0, 'David', 90, 9, '', NULL, 11, 37, '', 'Flash full. (He belive it is 16MG terminal)', 'Change system size (Restart and Press Menu and change sys size to 10).  If it resolved the issue then fine otherwise you have to send that to Skyzer. (Instructed as he wasn\'t on-site)', 1),
	(377, 3, '2020-12-10', '10:35:33', 0, 0, 'Gavin', 31, 14, '01558843', 37, 11, 37, 'Move 5000, Not accepting ASB credit cards issues has been there for 2 weeks Gavin said.\r\n\r\nTerminal is on latest and on WIFI.\r\n', 'Credit card issue with Only ASB cards.', 'Advised Gavin to get the exact same message from the Customer what happens when they swipe or insert the ASB credit card. ', 1),
