	(379, 1, '2020-12-10', '10:42:38', 0, 0, 'Nakul', 67, 18, '172977313071053901935357', NULL, 9, 33, 'TID: 10111978\r\n\r\nSent following email to Kiwibank,\r\nHi Nakul,\r\n\r\nIn terms of following customer, FYI\r\n\r\nAs I could not hear her well, \r\nSo, I said I am sorry but I can barely hear you! \r\nthen she replied very rudely and said I cant hear you, you cant hear me, I am done with this and just hung up.\r\n\r\nAs result, unfortunately, I could not help her out\r\n', '', '', 1),
