	(381, 1, '2020-12-10', '11:45:05', 0, 0, 'Abhi', 2, 14, '01162653', NULL, 11, 37, '14/12/2020\r\nSending one of the terminals at Skyzer so I\'ll have look.', 'Failing integration through Interface.', 'Try to do through USB if serial doesn\'t work and let us know if doesn\'t work.\r\n(He is trying and he will call us back shortly if doesn\'t work)\r\n\r\n11/12/2020\r\nHe swapped 5 M5000 but still not working with IdealPos.\r\nWorks fine when on attach Desk5000 & Move2500 but when he try on M5000 not working.\r\nTried different 5 M5000 but still not working on serial, \r\nchanged base,\r\ntested on site too,\r\nrepaired base,\r\nforget old bases,\r\nchecked base COM0,\r\nTried USB,\r\n\r\nRequested us to test on our end and let them know.', 2),
