	(383, 3, '2020-12-10', '12:14:08', 0, 0, 'James', 36, 21, '22308337', 44, 2, 12, 'Terminal TMS download on TCP , Not doing RKI on GPRS, advised James to do RKI on TCP IP again by doing from the beginning. ', '', 'As advised James followed the Guide lines and terminal started working again.', 1),
	(384, 1, '2020-12-10', '12:28:39', 0, 1, 'Nakul', 67, 18, '172977313071053901935357', NULL, 9, 33, 'As per Nakul requested through email.\r\n\r\nI spoke to customer. There are some issues with the connectivity there. I have advised her to undertake one more iteration to fix this. If that does not work she will most likely give up on QuickPay.\r\n\r\nCould you please call her back on 021 0902 0489 asap.\r\n', '', 'So, I uninstalled the app & installed latest and worked. ', 1),
