	(392, 1, '2020-12-11', '11:54:12', 0, 0, 'Nicolai', 27, NULL, '', NULL, 4, 41, '', 'He was not the actual dealer He instructed to call us for help from dealer.', 'So I asked him to ask Gracetek to call us then we can help I also helped the same customer yesterday and worked fine but today again called us so I asked him to approach Gracetek.\r\n\r\n\r\nGot a call from Gracetek:\r\nI asked him to swap terminal and try but he doesn\'t have any other NITRO so he was asking me to buy a new one, I said it is all up to you.\r\nNow, he gonna order a new one and see,\r\n\r\n11/12/2020\r\nSpoke with Vineel regarding the issue. ', 2),
