	(402, 1, '2020-12-14', '09:53:01', 0, 1, 'Jonathan', 52, NULL, '', NULL, 11, 37, 'Internet is not working at all on RKI, TMS or anything.', '(Email Fri 11/12/2020 5:13 pm)\r\nHi Team,\r\n \r\nAs discussed recently I cant connect a terminal through TCP-IP after I tried different terminals (ICt250-IWL252 etc.) even though the ethernet cable works perfectly. We run a couple of tests with a computer.\r\n \r\nAs it could a be a conflict with the terminal may I have the different ports. Ill let the customer know and his IT department will allow them.\r\n \r\nThank you\r\n', 'Follow up with a customer through call then send following details.\r\n\r\nPlease see the details below.\r\n\r\nTransactional IP and Ports:\r\n\r\nPrimary host port : 33876\r\nSecondary host port : 33876\r\n\r\nPrimary IP : Direct.paymark.co.nz\r\nSecondary IP : Direct2.paymark.co.nz\r\n\r\nRKI URL/IP and Ports:\r\n\r\nIP : 117.120.34.103\r\nPORT : 7540\r\n\r\nTMS URL/IP and Ports:\r\n\r\nTMS URL : www.skyzertms1.co.nz or www.skyzertms.co.nz\r\nPrimary IP : 103.216.132.29\r\nPORT : 3200 or 3201\r\n', 1),
