	(422, 1, '2020-12-16', '13:11:38', 0, 0, 'Dip', 40, 14, '', NULL, 11, 37, 'TID: 10834001\r\nLast Time: 1:25PM\r\nhappens with each transaction.\r\n', 'On pay way showing"Invalid Merchant"', 'Asked for a try with other cards: Same issue\r\nTry to do LOGON, Restart: Same issue\r\nNilesh called Paymark and Paymark says the customer has enabled pay way today so now the dealer has to contact merchant bank for that issue.\r\n(Instructed)\r\n', 1),
	(423, 1, '2020-12-16', '16:22:12', 0, 0, 'Rich', 28, 10, '', NULL, 11, 37, 'Tried other SIMS: works fine\r\nSpark SIM wasn\'t in use for 1 year, but he says if RKI and TMS working then LOGON should work.\r\nTried on 10 different terminals. \r\nAll terminal has the latest software and keys.', 'On spark does RKI, TMS, but fails LOGON.\r\nChange to Paymark and does LOGON works fine, now change back to Spark and does LOGON.\r\nAgain on Spark do RKI, TMS, Logon fails.', 'Discuss with the team.\r\n\r\n\r\n17/12/2020\r\nSpoken with Nilesh, he suggests that there is an issue with IP. \r\n\r\nFollowed Up to customer;\r\nAdvised customer, there is an IP issue currently, our team is working on that, and in the case in future, if you find the same problem, just call us back and we will solve it manually. (As Nilesh advised)', 1),
